import React from 'react'
import Head from 'next/head'
import '../styles/global.css'
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";

function App({ Component }) {
    return (
        <>
            <Head>
                <meta charSet="utf-8" />
                <title>MovieBox</title>
            </Head>
            <Component />
        </>
    )
}

export default App
